Param (
  [string]$version,
  [string]$media,
  [string]$parameters
)
$scriptName = 'VisualStudio.ps1'

# Common expression logging and error handling function, copied, not referenced to ensure atomic process
function executeExpression ($expression) {
	$error.clear()
	Write-Host "$expression"
	try {
		$output = Invoke-Expression $expression
	    if(!$?) { Write-Host "[$scriptName] `$? = $?"; $output|format-list -force; exit 1 }
	} catch { echo $_.Exception|format-list -force; $output|format-list -force; exit 2 }
    if ( $error[0] ) { Write-Host "[$scriptName] `$error[0] = $error";$output|format-list -force; exit 3 }
    if (( $LASTEXITCODE ) -and ( $LASTEXITCODE -ne 0 )) { Write-Host "[$scriptName] `$LASTEXITCODE = $LASTEXITCODE "; exit $LASTEXITCODE }
    return $output
}


Write-Host "`n[$scriptName] ---------- start ----------"
if ($version) {
    Write-Host "[$scriptName] version    : $version"
} else {
	$version = '2017'
    Write-Host "[$scriptName] version    : $version (default)"
}

if ($media) {
    Write-Host "[$scriptName] media      : $media"
} else {
	$media = 'D:\'
    Write-Host "[$scriptName] media      : $media (default)"
}

if ($parameters) {
    Write-Host "[$scriptName] parameters : $parameters"
} else {
    Write-Host "[$scriptName] parameters : (not supplied)"
}

if ($env:interactive) {
    Write-Host "[$scriptName] env:interactive : $env:interactive, run in current window"
    $sessionControl = '-PassThru -Wait -NoNewWindow'
} else {
    $sessionControl = '-PassThru -Wait'
}

switch ($version) {

	'2017' {

        # Visual Studio 2017 install is expecting workloads to be cached, some examples follow based on the media directory being vs2017layout
        # mkdir vs2017layout

        # All Workloads , all languages
        # .\vs_enterprise__1807683779.1487217311.exe --quiet --layout .\vs2017offline
        
        # ASP.NET with Web Deploy, US English only (1.67GB download)
        # .\vs_Enterprise.exe --layout .\vs2017layout --add Microsoft.VisualStudio.Workload.NetWeb --add Microsoft.VisualStudio.Component.WebDeploy --lang en-US
  
        # Unattended Install
        $currentDir = $(pwd)
        executeExpression "cd $media"
        executeExpression 'Get-ChildItem -Path .\certificates -Filter *.p12 | Import-PfxCertificate -CertStoreLocation cert:\localMachine\my'

        # Example parameters, note the language parameter differs for install compared to download
        # --add Microsoft.VisualStudio.Workload.NetWeb --add Microsoft.VisualStudio.Component.WebDeploy --addProductLang en-US
        $argList = "--quiet --wait --norestart $parameters"

	    Write-Host "`n[$scriptName] Start-Process `".\vs_setup.exe`" -ArgumentList `"$argList`" -PassThru -Wait"
        $proc = Start-Process ".\vs_setup.exe" -ArgumentList "$argList" -PassThru -Wait
        if ( $proc.ExitCode ) {
    	    Write-Host "`n[$scriptName] Install failed with LASTEXITCODE $proc.ExitCode`n"; exit $proc.ExitCode
        }
		executeExpression "cd $currentDir "
    }
  

	'2010' {
		$initFile = [Environment]::GetEnvironmentVariable('TEMP', 'user') + '\VisualStudioPremium.ini'
		$EncodedText = ''
		$ByteArray = [System.Convert]::FromBase64String($EncodedText)
		[System.IO.File]::WriteAllBytes("$initFile", $ByteArray)
	
		# cannot install from a read only source, so copy the source to temp
		$media = $media + '*'
		$installDir = [Environment]::GetEnvironmentVariable('TEMP', 'Machine') + '\IDEinstall'
		if (!( Test-Path $installDir )) {
		    Write-Host "[$scriptName] Create install directory ($installDir)"
			executeExpression "mkdir $installDir"
		}
		executeExpression "Copy-Item -Path $media -Destination $installDir -Recurse -Force"
		
		$filePath = "$installDir\Setup\setup.exe"
		$argList = @("/unattendfile", "$initFile")
		$proc = executeExpression "Start-Process -FilePath $filePath -ArgumentList $argList $sessionControl"
	
	    Write-Host "`n[$scriptName] Install summary ...`n"
	 	$output|format-list -force;
	}

    default { # 2012 - 2015
	
		$executable = Get-ChildItem $media -Filter *.exe
		$argList = @("/Q", "/S", "/LOG $env:TEMP\$executable.log", "/NoWeb", "/NoRefresh", "/Full")
		executeExpression "`$proc = Start-Process -FilePath `"$media$executable`" -ArgumentList `'$argList`' $sessionControl"
	}
}

Write-Host "`n[$scriptName] ---------- stop ----------"
exit 0